waitForDone = (n, s) => {try{return new Promise(resolve => {setTimeout(() => {resolve(n)}, s).catch(error => console.error(error.message));}).catch(error => console.error(error.message));} catch (e) {console.error(e);}};
hourChange = async () => {
  try {
    let waitHour = waitForDone(waiting=true, 500);
    await waitHour;}
  catch (error) {console.error(error);}
    //console.log('hour hand:', handHour);
    let moveCalcRad = (((Math.PI / 12) * handHour)*2);
    //if (handMinute >= 30) {moveCalcRad = moveCalcRad + 0.13;}
    moveCalcRad = moveCalcRad + (((Math.PI / 12) / (60 / handMinute))*2);
    //moveCalcRad = moveCalcRad + ((Math.PI / 12) / 2);
    clockHourHand.rotation.x = -Math.abs(moveCalcRad);
};
minuteChange = async () => {
  try {
    let waitMinute = waitForDone(waiting=true, 500);
    await waitMinute;}
  catch (error) {console.error(error);}
    //console.log('minute hand:', handMinute);
    let moveCalcRad = (((Math.PI / 60) * handMinute)*2);
    clockMinuteHand.rotation.x = -Math.abs(moveCalcRad);
};
clockFace.on('click', e => {
  currTime = new Date();
  if (currTime.getHours() > 12) {handHour = currTime.getHours() - 12;}
  else {handHour = currTime.getHours();}
  handMinute = currTime.getMinutes();
  try{minuteChange();} catch (e) {console.error(e);}
  try{hourChange();} catch (e) {console.error(e);}
});

